import React from "react";
import Coins from "./components/Coins/Coins";
import Navbar from "./components/Navbar/Navbar";
import { Routes, Route } from "react-router-dom";
import Coin from "./components/Coin/Coin";
import useCoins from "./hooks/list";
import { CoinsContext } from "./context/context";

function App() {
  const { handleChange, value, coins, filteredCoins } =
    React.useContext(CoinsContext);

  return (
    <div className="App">
      <Navbar value={value} handleChange={handleChange} />
      <Routes>
        <Route path="/" element={<Coins coins={filteredCoins} />} />
        <Route path="/coin" element={<Coin />}>
          <Route path=":coinId" element={<Coin />} />
        </Route>
      </Routes>
    </div>
  );
}

export default App;
